import React, { Component } from "react";
import Layout from "../components/Layout";

class Menu extends Component{

    render(){
        console.log(this.props.blogs);
        return(
            <Layout>
                <div className="container">
                    <div className="row">
                       
                    </div>
                </div>               
            </Layout>               
        )
    }
}

export default Menu;
